(()=>{"use strict";const updateIncludes=async()=>{const t=document.querySelectorAll("include"),r=new Map,e=Array.from(t).map((async t=>{const e=t.getAttribute("location");try{const o=await(async t=>{if(r.has(t))return r.get(t);const e=await fetch(t);if(!e.ok)throw new Error(`Network response was not ok: ${e.status}`);const o=await e.text();return r.set(t,o),o})(e);t.innerHTML=o}catch(t){console.error("Error fetching data:",t)}}));await Promise.all(e)};updateIncludes()})();